import { useCookies } from "react-cookie";
import { Navigate } from "react-router-dom";

export const MainPage = () => {
  const [cookies, _] = useCookies(["access_token"]);

  if (!cookies.access_token) {
    return <Navigate to="/auth" />;
  }

  return (
    <div>
      <h1>Main Page</h1>
    </div>
  );
};
